                    //           : (prev[curr.time] = [curr])

                    //         return prev
                    //         }, {})
                    //     )
                    //     .map(([time, componentTome]) => {
                    //         return (
                    //             <div className='spirit__jadwal-content' key={time}>
                    //                 <div className='spirit__jadwal-time'>
                    //                     <h1>{time}</h1>
                    //                 </div>
                    //             </div>
                    //         )
                    //     })
                    // }
                )
            })
        }

        <div className='spirit__jadwal-date'>
            <h2>Senin, 27 November 2022</h2>
            <div className='spirit__jadwal-content'>
                <div className='spirit__jadwal-time'>
                    <h1>17:00</h1>
                </div>
                <div className="spirit__jadwal-container">
                    {/* {jadwalData.map((item, index) => (
                        <NonH2H data={item}/>
                    ))} */}
                </div>
            </div>
        </div>
    </div>
  )
}

export default SeniJadwal
